import React from 'react';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Home from ""

const App = () => {
    return <div>
        <Router>
            <Switch>
                <Route exact path="/" component={Home}/>
            </Switch>
        </Router>
    </div>
}

export default App;
